import React from 'react'
import './profile.css'
import { FaEye } from 'react-icons/fa';
function Profile(){
    const toggleMenu = () => document.body.classList.toggle("open");
  
    
    return(
<div> 
<button class="burger" onclick={toggleMenu()}></button>
    <div class="menu">
      <nav>
        <a href="#" >About</a>
        <a href="#" >Portfolio</a>
        <a href="#" >Services</a>
        <a href="#" >Contact</a>
      </nav>
    </div>
   
</div>
    );
}
export default Profile
